import { render } from "@testing-library/react";
import React, { Component } from "react";
import All_Images from "./images/ImageList"



class Photos extends Component{


    render(){
        console.log(All_Images[2].image.substr(All_Images[2].length -4))
        return (
            <>
               <div class="item">
                   <div class="polaroid"><img src = {All_Images[2].image}></img>
                    <div class="caption">Love ballons</div>
                </div>
                </div>


            </>
        );
    }

}

export default Photos;
